function Imagen (x){
for (n of tileData) {
    const x = n.img+'.jpeg' ;
  }
}
return(
        <>
        <img src={Imagen(x)} alt="Girl in a jacket" width="500" height="600"></img>
        {Products}
        </>
)
}

export default Productos
